import pdb
import requests
from lxml import etree
import json
import os
import string
from base import *
from datetime import datetime

def main():
    output_list = []
    session = requests.Session()
    file_name = 'output/' + os.path.splitext(os.path.basename(__file__))[0] + datetime.now().strftime('_%Y_%m_%d_%H_%M_%S') +'.csv'
    history = []
    with open(file_name, mode='w') as output_file:
        writer = csv.writer(output_file, delimiter=',', quotechar='"', quoting=csv.QUOTE_ALL)
        writer.writerow(["School", "Sports",  "Position", "Name", "Email"])
        base_url = 'http://www.wiaa.com/'
        url = "http://www.wiaa.com/directory.aspx?SecID=654"
        for alpha in string.ascii_lowercase:
            try:
                headers = {
                    'Accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9',
                    'Content-Type': 'application/x-www-form-urlencoded',
                    'Cookie': '__utma=232743321.1712318367.1582796640.1582796640.1582796640.1; __utmc=232743321; __utmz=232743321.1582796640.1.1.utmcsr=(direct)|utmccn=(direct)|utmcmd=(none); __utmt=1; __unam=7f7d86e-1708607c83f-3d44e2f3-21; __utmb=232743321.7.10.1582796640',
                    'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.122 Safari/537.36'
                }
                formdata = {
                    '__EVENTTARGET': '',
                    '__EVENTARGUMENT': '',
                    '__LASTFOCUS': '',
                    '__VIEWSTATE': '',
                    '__VIEWSTATEGENERATOR': '42A65EF5',
                    '__EVENTVALIDATION': '',
                    'ctl01$RadMenu1': '',
                    'SrchBox': '',
                    'TypeID': '1',
                    'SearchArg': alpha,
                    'btnSrch': 'Search',
                    'DistType': '',
                    'SchLevel': '',
                    'ClassID': '0',
                    'LeagueID': '0',
                    'SchDistID': '0',
                    'DistrictID': '99999'
                }            
                response = session.post(url, headers=headers, data=formdata).text
                data = etree.HTML(response)
                schools = eliminate_space(data.xpath('.//table[@id="SchoolList"]//a/@href'))            
                for school in schools:
                    school = validate(school.split('&Type')[0])
                    if school not in history:
                        history.append(school)
                        try:
                            s_url = base_url + school
                            s_response = session.get(s_url, headers=headers).text
                            s_data = etree.HTML(s_response)
                            s_name = validate(s_data.xpath('.//span[@id="Name"]//text()'))  
                            s_email = validate(s_data.xpath('.//span[@id="AthleticSecyEmail"]//text()'))
                            if s_email == '':
                                s_email = validate(s_data.xpath('.//span[@id="ADEmail"]//text()'))
                            e_check = {
                                'status' : True,
                                'idx' : 0,
                                'checked' : False
                            }
                            events = s_data.xpath('.//table[@id="SportList"]//tr')
                            for event in events:
                                tds = event.xpath('.//td')
                                content = eliminate_space(event.xpath('.//text()'))
                                if len(content) > 1 and 'Sport' not in validate(content):
                                    try:
                                        e_sport = content[0]
                                        e_name = get_name(content[1])
                                        # e_emails = generate_email(e_name, s_email) if e_check['status'] else ['']
                                        # if not e_check.get('checked'):
                                        #     e_check = check_email_combination(session, e_emails)
                                        if is_in_needed_sports(e_sport):
                                            e_email = verify_email(session, generate_email(e_name, s_email))
                                            output = [
                                                s_name, e_sport, "HEAD COACH", 
                                                e_name, e_email
                                            ]
                                            writer.writerow(output)
                                    except Exception as e:
                                        pass
                        except Exception as se:
                            print(se)
            except Exception as ae:
                print(ae)

if __name__ == '__main__':
    main()